import React, { useState } from "react";

const Home = () => {
  return (
    <div>
      <input
        type="text"
        value={name.firstname}
        onChange={handleFirstNameChange}
        placeholder="First Name"
      />
      <input
        type="text"
        value={name.lastname}
        onChange={handleLastNameChange}
        placeholder="Last Name"
      />
    </div>
  );
}

export default Home;
